import './App.css';

function App() {
  return (
    <div className="App">
        <h1> React Todo App </h1>

        <div className="input-wrapper">
          <input type="text" name="todo" placeholder="Добавить новое (невыполнимое) дело!" />
          <button className="add-button">Добавить</button>
        </div>
    </div>
  );
}

export default App;
